#noticias 
#jacaré 
Um bombeiro civil capturou um jacaré-anão (Paleosuchus palpebrosus) no início da tarde desta sexta-feira (4) na Lagoa Grande, no município de Paracuru, na Grande Fortaleza. O animal não apresentava nenhum ferimento e media cerca de um metro e meio.

Após ser capturado, o animal foi levado pelo bombeiro civil para a sede da Guarda Municipal de Paracuru, onde aguarda a chegada de uma equipe do Batalhão de Polícia do Meio Ambiente (CPMA), que fará o resgate do animal.

Jacaré-anão

Também é conhecido como jacaré-paguá e jacaré-mirim, o jacaré-anão é considerado um dos menores crocodilianos do mundo. A média de altura do animal é de 150 centímetros em machos e 120 em fêmeas.
